import React, { useEffect } from "react";
import { useState } from "react";

const ShowExams = () => {
  const [data, setData] = useState("");
  const [topicData, setTopicData] = useState([]);

  const deleteRows = (index) => {
    const updatedRows = [...data];
    updatedRows.splice(index, 1);
    setData(updatedRows);
    // fetch("https://localhost:8443/onlineexam/control/deleteexam", {
    //   method: "DELETE",
    // });
  };

  const examDetails = async (examId) => {
    console.log("exam Details is called....");
    console.log(examId);
    const map = {
      examId: examId,
    };
    // const examId= examId;
    // const response = await fetch(
    //   "https://localhost:8443/onlineexam/control/getExamTopicEvent",
    //   {
    //     method: "POST",
    //     credentials: "include",
    //     body: JSON.stringify(map),
    //     headers: {
    //       "Content-type": "application/json",
    //     },
    //   }
    // );

    const addAnotherTopic =()=>{
      return(
        <div>
           <div className="col-10">
        <form action="" >
            <div className="mb-3">
              <label
                htmlFor="exampleInputEmail1"
                className="form-label float-start"
              >
                ExamId*:
              </label>
              <input
                type="text"
                id="examid"
                className="form-control "
                placeholder="ExamId * eg(1)"
                name="examId"
                value="Tamil Exam"
                readOnlyd
                // value={examid}
                // onChange={(e) => setexamid(e.target.value)}
              />
              <p id="p1" className="text-danger"></p>
            </div>
            <div className="mb-3">
              <label
                htmlFor="exampleInputEmail1"
                className="form-label float-start"
              >
                TopicId*:
              </label>
              <input
                type="text"
                id="examid"
                className="form-control "
                placeholder="TopicId * eg(1)"
                name="examId"
                // value={examid}
                // onChange={(e) => setexamid(e.target.value)}
              />
              <p id="p1" className="text-danger"></p>
            </div>
            <div className="mb-3">
              <label
                htmlFor="exampleInputEmail1"
                className="form-label float-start"
              >
                Percentage:
              </label>
              <input
                type="text"
                id="examid"
                className="form-control "
                placeholder="Percentage * eg(100%)"
                name="examId"
                // value={examid}
                // onChange={(e) => setexamid(e.target.value)}
              />
              <p id="p1" className="text-danger"></p>
            </div>
            <div className="mb-3">
              <label
                htmlFor="exampleInputEmail1"
                className="form-label float-start"
              >
              TopicPassPercentage:
              </label>
              <input
                type="text"
                id="examid"
                className="form-control "
                placeholder="Topic Pass Percentage * eg(25%)"
                name="examId"
                // value={examid}
                // onChange={(e) => setexamid(e.target.value)}
              />
              <p id="p1" className="text-danger"></p>
            </div>
            <div className="mb-3">
              <label
                htmlFor="exampleInputEmail1"
                className="form-label float-start"
              >
                QuestionsPerExam:
              </label>
              <input
                type="text"
                id="examid"
                className="form-control"
                placeholder="Questions per Exam * eg(60)"
                name="examId"
                // value={examid}
                // onChange={(e) => setexamid(e.target.value)}
              />
              <p id="p1" className="text-danger"></p>
            </div>
            <div className="mb-3">
            <button className="btn btn-primary ">Finish</button>
            </div>
          
        </form>
      </div>   
        </div>
      )
    }
    // const result = await response.json();
    // const text=JSON.stringify(result);
    // console.log(result.ExamDetails);
    // // const output = result.ExamDetails;
    // setTopicData([...output]);
    // // console.log(text);
    // console.log("topic data...", result.ExamDetails);
    // console.log("***********************************************");
    // console.log("NAREN - MASTER");
    // console.log(output);
    // console.log(topicData);

    return (
      <div className="container bg-dark">
        <div>
          <div className="col-3"></div>
        </div>
      </div>
    );
  };

  async function fetchInfo() {
    console.log("fetch obj is called....");

    // const response = await fetch(
    //   "https://localhost:8443/onlineexam/control/examMasterListEvent"
    // );

    // const text = await response.json();
    // console.log(text);
    // setData(text.ExamData);
  }

  useEffect(() => {
    fetchInfo();
  }, []);

  return (
    <div className="container">
      <div className="col-8 ">
        <table className="table table-striped ">
          <thead>
            <tr>
              <th>ExamId</th>
              <th>ExamName</th>
              {/* <th>CreationDate</th>
              <th>ExpirationDate</th>
              <th>No of Questions</th>
              <th>Duration Minutes</th>
              <th>Pass Percentage</th>
              <th>Questions Randomized</th>
              <th>Negative Mark value</th> */}
              <th></th>
              <th></th>
              <th></th>
              <th></th>
            </tr>
          </thead>

          <tbody>
            {data
              ? data.map((obj, value) => (
                  <tr>
                    <td>{obj.examId}</td>
                    <td>{obj.examName}</td>
                    <td>{obj.description}</td>
                    {/* <td>{obj.creationDate}</td>
                    <td>{obj.expirationFate}</td>
                    <td>{obj.noOfQuestions}</td>
                    <td>{obj.durationMinutes}</td>
                    <td>{obj.passPercentage}</td> */}
                    {/* <td>{obj.questionsRandomized}</td> */}
                    {/* <td>{obj.answersMust}</td> */}

                    {/* <td>{obj.enableNegativeMark}</td> */}
                    {/* <td>{obj.negativeMarkValue}</td> */}
                    <td>
                      <button className="btn btn-primary">Edit</button>
                    </td>
                    <td>
                      <button
                        className="btn btn-primary"
                        onClick={() => {
                          examDetails(obj.examId);
                        }}
                      >
                        Details
                      </button>
                      {/* <button className="btn btn-primary" onClick={examDetails(obj.examId)}>Details</button> */}
                    </td>

                    <td>
                      <button
                        className="btn btn-danger"
                        onClick={() => deleteRows(value)}
                      >
                        Delete
                      </button>
                    </td>
                  </tr>
                ))
              : ""}
          </tbody>
        </table>
      </div>
      <div className="container my-5">
      <table className="table table-striped">
      <thead>
                <tr>
                  <th>Exam ID</th>
                  <th>Topic ID</th>
                  <th>Questions Per Exam</th>
                  <th>Percentage</th>
    
                  <th>Topic Pass Percentage</th>
                  <th>View Question</th>
                  <th>Delete</th>
                </tr>
              </thead>
              <tbody>

      {topicData ? (
        topicData.map((obj, value) => {
         return(
                <tr key={value}>
                  <td>{obj.examId}</td>
                  <td>{obj.topicId}</td>
                  <td>{obj.questionsPerExam}</td>
                  <td>{obj.percentage}</td>
    
                  <td>{obj.topicPassPercentage}</td>
                  <td><button className="btn btn-primary">View Question</button></td>
                 
                  <td><button className="btn btn-danger">Delete</button></td>
                </tr>
             
          
        )})
      ) : (
        <>No data</>
      )}
       </tbody>
            </table>
            <button className="btn btn-primary offset-10" onClick={add}>Add Another Topic</button>
            </div>
    </div>
  );
};
export default ShowExams;
